import "../styles/login.css";

import { NavLink } from "react-router-dom";

const Login = () => {
    return ( 
        <main>
            <section className="login">
                <div className="container">
                    <div className="login__inner inner">
                        <h1 className="login__title">Войти в личный кабинет</h1>
                        <form className="login__from">
                            <input className="login__from-input" type="tel" placeholder="Номер телефона"></input>
                            <input className="login__from-input" type="password" placeholder="Пароль"></input>
                            <button className="login__from-btn">Войти</button>
                        </form>
                        <NavLink className="login__link" to="/registration">Зарегистрироваться</NavLink>
                    </div>
                </div>
            </section>
        </main>
     );
}
 
export default Login;
